import axios from "axios";

const API = axios.create({
  baseURL: "http://localhost:8081/api", // backend base URL
});

// user-projects APIs
export const startProject = (username, projectId) =>
  API.post("/user-projects/start", null, { params: { username, projectId } });

export const endProject = (username, projectId, pricePerHour) =>
  API.post("/user-projects/end", null, { params: { username, projectId, pricePerHour } });

export const getProjects = () => API.get("/user-projects");
